import React from './react';
import Card from './Cards';
import Sdata from './sdata';

const Netflix = () =>{
    return (
        <Card
            key={Sdata[1].id}
            imgsrc={Sdata[1].imgsrc}
            title={Sdata[1].title}
            sname={Sdata[1].sname}
            links={Sdata[1].links}
        />
    );
}

export default Netflix;
